import { createRoot } from "react-dom/client";

const TodoList = () => {
  return (
    <ul>
      <li>List item</li>
      <li>List item</li>
    </ul>
  );
};
const el = (
  <div>
    <h1>My Todo list</h1>
    <input placeholder="search" />
    <TodoList />
  </div>
);
const root = createRoot(document.getElementById("root"));
root.render(el);
